                "title": "Water Temple without Iron Boots",
                "description": "Ocarina of Time Randomizer\n\nSometimes the seed gives you the opportunity to beat Water Temple out of logic without the iron boots. You can reach everything except the basement chest if you have enough items/songs. Everything shown here is in the \"Accessible\" ruleset as of 1/30/2019."
