                "description": "In Low% MST, you should do trials clockwise, because you have to get fairies before Fire Trial and anyway you go to fairy room for unloading the block in front of Light Trial\n\nUnloading the block is performed by sidehopping in the corridor leading to fairy room like I did in this video, that sidehoppings allows you to do beam duplication quickly, and it causes unloading the block\nStand end of the corridor (the side close to the fairy room), do sidehoppings back and forth (left, right, left, right), on the 33rd or 35th sidehop, continue to the mainroom and enter Shadow Trial once or twice, then the block in front of Light Trial should be unloaded (it works fine for me with 35 sidehoppings and entering Shadow Trial once , but I don't know how much times you have to do for you, please try it yourself)\n\nIn this video, I go out right after entering Light Trial room and fall to OoB, that's because the sliver rupees room is messed up due to actors unloading and you have to \"reset\" the area by savewarping, dying or something for fixing it\nI think falling to OoB is a fast way to fix it because you don't have to do sidehoppings again, a thing is you lose a heart by it (you have to keep 3 hearts until Fire Trial for safe), but it shouldn't be that much issue since you could get a heart from enemies in most cases, also you could take a heart from right side pot in the last room even if enemies didn't drop any hearts\n\nIn the sliver rupees room, you have to do ground jump with chu for the center rupee\nTarget to the wall and left sidehop, pull out a chu, drop the chu drop the chu around 3rd black frame, roll to pot and mash A while holding R, then you could store ground jump (the setup was made by tekyla)\nIt's lenient but if you pull out a chu too early, a boulder would hit Link when he shielded explosion, so there is no need to hurry I guess"
