                "title": "OoT: Fire Temple Block Jump Strats",
                "description": "6 Different Strats, ordered from easiest to hardest.\nIf it says to roll the stick, you have to do it at a certain speed.\n\n1st one:(~7.15 sec)\n**Slowest but Easiest Strat.\n1. Get in the corner at the left of the block\n2. Sidehop right\n3. Crouch Stab left\n4. Backflip\n5. Aim where I do (flicking right mostly gives you this)\n6. Jump and hold upleft\n\n2nd Strat (~5.41)\n1. Climb up\n2. Hold right and slash, hold shield\n3. Sidehop left\n4. Line up the hookshot slightly to the side\n5. Jump and hold upleft\n\n3rd Strat (~4.25)\n1. Climb up\n2. Hold right and slash, hold shield\n3. Sidehop left\n4. C-up. Hold right and IMMEDIATELY hit shield after hitting right\n5. Jump and hold upleft\n\n4th Strat (~2.63)\n**This is the fastest Strat.\n1. Climb up at the rightmost side\n2. Hold right and Slash, hit Shield\n3. Sidehop left\n4. Hold right and roll the stick to up to jump and get up there\n\n5th Strat (~3.47)\n1. Jump on the leftmost side\n2. C-up and hold right, cancel with shield once it passes the block\n3. Sidehop left once\n4. Do an ESS roll down\n5. Hold upright when he rolls\n\n6th Strat (~3.91)\n1. Jump on leftmost side\n2. Do 2 ESS turns or hold ESS for 2 frames\n3. Sidehop right twice\n4. Do a ESS down roll\n5. Hold right then roll the stick to up\n\nPick whichever one is the most comfortable for you. Incorporate faster ones as you improve."
