                "description": "You never know when these could be useful (like skipping hookshot in a bingo race). They are also good if you are bad at hookshot ladder clipping. The Zora's Domain setup can be used on any ladder that is not right near a wall or on a slope (which is why I had to make a different one for deku). It is worth noting that these can be used on ladders that can't be hookshoted. When you let go of the ladder, you need to hold the control stick away from the ladder so you don't clip back through it.\n\nGlitch was discovered by multiple people, not by me. These are my setups.\n\nDeku:\nClimb the ladder and go up to the wall with your sword out. Jumpslash and then swing your sword twice. Turn and sidehop.\n\nZora's Domain/Other:\nClimb up the ladder then hold z and backwalk to make sure you are right against the ladder. Then turn around and backflip. Roll and swing your sword once. Then  turn and sidehop."
