                "title": "How to get Ice Arrows as Child Link",
                "description": "This is a useful trick in bingo races and for showing off.\n\n1. Enter Gerudo's Training Ground (I have a previous video showing how to do this)\n2. From the entrance, run straight across into the next room\n3. Climb the fence in front of you and get roughly half way between the top and the bottom, to give you room to manoeuvre for the next step\n4. Hold Z.\n5. Still holding Z, press down and A simultaneously to drop from the fence\n5. Still holding Z, very soon after press up, bombchu button and R to shield drop the bombchu and regrab the fence\n6. If done properly, Link will clip through the fence, and on the other side of the first fence is the chest containing Ice Arrows\n\nThis trick looks a lot harder than it is. Once you figure out the finger positions, it's very possible to get 95%+ consistency.\n\nLike it? Buy me a pint! https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=BW42HRMSHBXJY"
