                "description": "Make sure water temple door is open already (whether by longshot or precise hookshot)\n\nGet ISG (if you don't know how to ISG, you can sometimes do this without ISG but it's not very consistent. I recommend looking up a tutorial about how to get ISG, and then you can pretty easily get it by interrupting your sword stab by checking the sun pedestal)\n\nPut sword away\n\nHold Z and keep holding it until instructed to stop\n-Target tree root, and move to the right and start pressing A to roll into the tree. The repeated rolls will slightly put you into a corner, once you stop moving from your rolls you are in place.\n-Backflip twice\n-Press A to roll to the side, A again to roll forward\n-Sidehop left 8 times (individual hops, might go too far if you hold left the whole time)\n-Press A to roll to the side\nRelease Z\n\nHere, ESS turn to the left (i think that's what it's called idk), or if you dont know how to do this, you can just flick your stick left very briefly \n\nHold Z and keep holding it until instructed to stop\n-start holding R to shield (make sure you do this AFTER you start holding Z, otherwise you're going to just roll into the water. Untargeted shielding makes you lose ISG, and ISG is what keeps you from rolling completely off the hill.)\n-roll forward while still holding R (you should still be holding shield when you finish rolling)\nRelease Z and R\n\nHere, you can drop something out of your bottle, or pull out an ocarina. you should drop down next to the water temple entrance. Hold up + slight left to swim inside.\n\nidk maybe this will be useful for ppl who dont know how to go OOB and wanna get into water with minimal items. in randomizer, you can still do a ton of checks in water temple with cutscene diving if you dont have irons or a longshot."
