                "url": "https://www.youtube.com/embed/GowzGTI0qlA",
                "title": "OoT - Easy Haunted Wasteland (No Lens of Truth) - Quick Reference",
                "description": "This video is part of a series of reference videos for various tricks that may be encountered during a Max% Adult (and other) runs.\n\n------------------------\n\nThis is the path that I usually take through the desert.  I like to avoid using visual indicators in the sand when I can.  It may take you a few runs through to get consistent at it, but it's easy to adjust your position as you go once you know the path.\n\nIt's important that you don't stop sidehopping until after the 4th sidehop once you see the flags align.\n\n\n1. Position Link in front of the wall, between the red lines shown in the video\n2. (Z/L) Target to lock your angle\n3. Backwalk until you see the two flags align\n4. Start Sidehopping right\n5. Once you see the next set of flags align, count 4 more Sidehops\n6. Shield turn Down-Left\n7. Backwalk until you can exit to the west\n\n\n------------------------\n\nThe featured game is The Legend of Zelda: Ocarina of Time\n\nThis setup was created by EpicBrownie\n\nEmulation Software: PJ64 Version 1.6\nRecording Software: OBS\nController Viewer: NintendoSpy originally by jaburns - source code modified by EpicBrownie"
