                "description": "So this is how you do it:\n\n-You'll need the Biggoron's Sword, an Empty Bottle and a Light Arrow. Be sure you have all of them equipped.\n\n-As soon as the fight starts, do a Jump Attack away from the central platform (to do a Jump Attack, first draw your sword with B and then press A while Z-Targeting).\n\n-Stand on the falling platform, and before it falls to the ground, grab the side of the central platform and climb up.\n\n-Stand right on the edge of the central platform and take out your Empty Bottle.\n\n-Use the Empty Bottle to reflect the energy ball Ganondorf sends towards you. He won't reflect it back, so it will stun him.\n\n-Quickly shoot a Light Arrow at him. He will then fall to the ground.\n\n-Draw your sword with B and be prepared to do some Crouch Stabs as soon as he's on the ground (to do a Crouch Stab, press B while holding down R and while NOT Z-Targeting).\n\n-With five well-timed Crouch Stabs, you'll defeat him.\n\nIf you do this fast enough, you'll beat him in 16 - 20 seconds. It was 18 seconds in this video."
