                "description": "Watch live at http://www.twitch.tv/zfg1\n\nMax% Child is a challenge where you get as much stuff as possible without ever becoming adult.  This is a challenge that's been around for years but no one has really done a full run of it, due to difficulty, length, and arbitrariness.  I just thought it would be fun to try to optimize it and try it as a speedrun.\n\nHere are some of the more interesting points of the run if you dont want to watch the entire thing:\n\nLight Arrows - 16:00\nGerudo fortress/odd mushroom - 39:37\nMask RBA for equipment - 2:07:30\nGoron tunic - 2:13:56\nIce cavern - 2:19:40\nWater Temple part 1 - 2:34:25\nGanon's castle (master sword + gold gauntlets) - 3:11:00\nWater temple part 2 - 3:18:00\nGerudo Training Grounds - 3:42:35\nSpirit Temple - 3:50:35\nFire temple part 1 - 4:11:52\nSetup for fire temple part 2 - 4:31:45\nFire temple part 2 - 4:38:30\nForest Temple - 4:57:35\nShadow Temple - 5:19:18\n\nList of Everything you CAN get:\n-All main C items except fire arrows (including longshot, and highest adult trade item is odd potion)\n-all swords/shields/boots/tunics (3rd sword slot is broken giants knife, not biggorons sword)\n-Highest upgrade for deku nuts, deku seeds, deku sticks, bombs\n-30 arrow quiver\n-gold gauntlets\n-gold scale\n-giants wallet\n-gerudo card, stone of agony\n-forest, water, shadow medallions\n-all 3 spiritual stones\n-zeldas lullaby, sarias song, suns song, eponas song, song of time, requiem of spirit\n-16 3/4 hearts (no duping/rba)(includes 37th hp)\n-79 gold skulltulas (no duping)\n-map and compass in all dungeons (except forest temple compass)\n-all boss keys\n\nEverything you CANNOT get:\n-6 heart pieces, 2 heart containers\n-21 gold skulltulas\n-light, fire, spirit medallions\n-all warp songs except requiem\n-song of storms\n-any higher quiver upgrade\n-fire arrows\n-biggorons sword\n-forest temple compass\n-double defense \n\nBecause you can only wrong warp to ganon's castle once, and we need to savewarp out of the escape to get gold gauntlets, its impossible to both get gold gauntlets and beat ganon.  Since this is about getting the highest amount of items possible, gold gauntlets is gotten over beating ganon and getting the master sword from temple of time is used as the end point.\n\nI'm playing on the gamecube version because it makes a few tricks easier, and with how hard this run is I want to make everything as easy as possible if I can."
