                "description": "Thanks to Rosewater for finding useful stuff for this trick\n\nI used Ground Clip setup in this video, but Ground Clip works with the setup from corner only: https://youtu.be/lqQHhnEt-R8\nOr you can clip with these setup as well, but these are initial setup from chest, so basically using non-initila setup from corner is recommended\nhttps://twitter.com/bakeneko1048/status/990893996485496832\nhttps://twitter.com/bakeneko1048/status/990500213172269057\nhttps://twitter.com/bakeneko1048/status/990461736514871296\n\nOriginally, Rosewater found you can clip and land onto the boss room without hover boots: https://youtu.be/cnb1rhXoW_8\nOriginal way used hookshot for avoiding to void out, but he found that you can avoid it by just holding down and actually it's more lenient than hookshot way, I just made setup and tested working frames\n\nThis trick is really useful for some Low% categories since you can't get Hover Boots\nThere was a way for EPG Boat Skip without Hover Boots, but it required extra chus, fairy and many buffering: https://youtu.be/OKDxhCppIpQ\nNew way is faster, saves 3 chus, doesn't require fairy, much less buffering... so it's extremely better\n\nGround Clip Boat Skip is found by Jolin, Fox (and N3rds helped them): https://youtu.be/DUDjM0CIGGE\nOriginal method was complicated, but Rosewater found another way for clipping which requires only one frame perfect input: https://youtu.be/YOLy16ii3rg\nGround Clip Boat Skip with Hover Boots Setup: https://youtu.be/CNl5EKBqXwQ"
