                "url": "https://www.youtube.com/embed/QxN5-QHdODY",
                "title": "OOT: Market SoS skull (no bombs, no deku stick, no boomerang)",
                "description": "- Break wall, Jumpslash, get ISG\n- For the whole trick keep shield up :)\n- Get in the corner, target wall, two quick backflips\n- Then two spaced backflips should kill the walltulla\n- Forward sidehop (ess down, roll, mash (or time) A press with stick up left)\n- Wait for a hit of the gold skulltula\n- Just roll to kill the gold skulltula (if it doesn't, you can do another forward sidehop to get closer)\n- Target the token to reset camera\n- Turnaround (same as Spirit hover). For example, Down roll then input down at the end of the roll\n- Backflip to collect the token\n\nUseful for bingo, this strat aims at collecting the gold skulltulla token in Song of Storms (SoS) grotto of Hyrule Castle (Market area). It doesn't use a stick, or bombs, and is quite reliable.\nThe only factor i've seen fail is if you switch stance while hovering. If you can, try to always stay in a left facing stance, I've noticed it fails less often.\n\nSince it's a back in time goal (BiT) you will always have kokiri sword, but of course it works with anything that you can get ISG with."
