                "description": "This setup uses the wall corner so it works regardless of chest size matches contents. Targeting the wall can sometimes give you the wrong angle, as can be seen in this video :D\n\n- Target the wall\n- Get in the corner (e.g., left side hop, shield flick, neutral roll)\n- Turn 90 degrees left (e.g. shield turn or ESS left)\n- 4 side hops left\n- 1 side hop right\n- 1 side hop left\n- 1 side hop right\n- 1 side hop left\n- ESS 3 frames right\n- 1 side hop left\n- Drop the blue fire on the correct frame (the frame with both of Link's feet on the ground)\n\nUPDATE: if you have bottle in hand, you can press the bottle button in mid-air so Link drops the blue fire when he lands, so you don't have to time it. After killing the freezard and opening the chest, you can jump back down to the blue fire, scoop it up in a bottle, and jump back up to the chest area before doing this setup."
