                "title": "Ocarina of Time: Adult Side of Spirit Temple as Child without Explosives, Consistent Setup",
                "description": "How to execute:\n\n1) Get on the arm and walk up the crack near the shoulder. \n2) Get Link's right foot's shadow to be angled like in the video\n3) Angle such that the right side of the B button is touching the edge of the arm\n4) Roll, Z-target in mid-air, then Jumpslash to get on the shoulder\n5) Go to the corner and inch Link so that only his right foot is on the shoulder\n6) Using inching and rolling, reach the other corner so that you're almost on the very edge.\n7) Angle Link so the bottom of the first heart (top left) is touching the spot where the colors change.\n8) Pause, then starting at the top-right angle, slowly change the angle toward 0 degrees. Find the angle where the cursor stops moving to the right.\n9) Unpause, hold that angle and jumpslash with good timing onto the statue.\n10) Slide to the other side and if you get sort of stuck toward the end, hold up right. But be careful not to hold it for too long or you'll jump off the shoulder.\n\nThese steps may seem complicated, but once you try it, you'll realize it's not bad at all.\n\nEnjoy."
