                "title": "GC - Spirit Trial Bombchu Chest As Child w/ Only Sword (or stick)",
                "description": "Incredibly useful to know for Beta Quest.\n\n1) Stun the Beamos statue. If you're too close to it, you'll recoil off of it an not stun it. Stand a bit further back and \"tipper\" it to ensure you'll stun it.\n2) Run over to the Armos statue that's to the right of the entrance door and pull it 7 times.\n3) Quickly draw your sword and Z-target jumpslash the Beamos to stun it again. If you do 7 pulls and you've been hustling, it should be getting ready to fire at you. Be sure to wait until its \"wake up\" animation is finished, else you won't stun it.\n4) Swap to the other side of the statue and push an additional 8 times. We're pushing instead of pulling so we won't get hit by the slider behind the Beamos as we're moving the statue into position.\n5) Head to the wall and align yourself with the pillar design on the wall.\n6) You'll probably have aggro'd the Beamos again. You are protected by the Armos statue while you get your position, but you'll need to get the Beamos to stop attacking before you go for the floating silver rupee. Do three sidehops right to get a silver rupee and the Beamos will stop firing at you. Then quickly sidehop left three times to return to your position before you get hit by the slider protecting the rupee.\n7) Once in position against the wall and the Beamos is not focusing you, hold Z and backwalk towards the statue you pushed, backflipping onto it when you get to it.\n8) Once you are on top of the statue, release Z, hold down, and roll as soon as possible.\n9) While still holding down, jumpslash just shortly after jumping off of the statue. The timing is a bit fickle."
