                "description": "This video is part of a series of reference videos for various tricks that may be encountered during a Max% Adult (and other) runs.\n\n------------------------\n\nThis is a pretty simple trick to clip through the wall, creating a very nice shortcut.\nThis setup is extremely fast and consistent.\n\n1. Jump over to the block/crystal platform with the camera facing away from it.  (Jump from around where I do in the video).\n2. Tap Up and Z/L Target to lock this angle.\n3. Pull out a Bomb and get all the way into the corner\n4. Once in the corner, release the Control Stick and then release Z/L Target.\n5. When the Bomb explodes, Link will clip.  Hold Left after clipping to ensure Link lands back in bounds.\n\n------------------------\n\nThe featured game is The Legend of Zelda: Ocarina of Time\n\nClip discovered by ZFG\nClip Using a Bomb discovered by Kazooie and Librari\nThis setup created by enu405969\n\nEmulation Software: PJ64 Version 1.6\nRecording Software: OBS Studio\nController Viewer: NintendoSpy originally by jaburns - source code modified by EpicBrownie"
