                "title": "Itemless cucco jump setup w/ spin 2 win",
                "description": "If you have trouble reading the steps I'll put them here as well:\n\nItemless child gerudo bridge skip setup\nwith 5 frame perfect inputs\n\nThis setup \"invented\" spin 2 win afaik. The technique repeatedly utilizes that ess turning in increments of 1800 is different from ess turning in 90 and 180 degree directions. It is cruicial to understand that you cannot let link catch up to the joystick direction resulting in non-1800 increments. Exceptions are when 90 degree turns are intended. Frequently tapping target is the safe technique.\n\nPOSITION SETUP:\ntarget left wall\nEss turn in increments to the left, 1\u00be of a turn and a little bit more. Standing in roughly the shown spot you should be facing the torch on the other side of the bridge. Angle should be 53264\n\nCross the bridge and go into corner. Sidewalk for a second to ensure in corner.\n\nBackwalk onto post. 3 frame window to release down (gasp frame or 1-2 after). 1st time position is always wrong. repeat - don't ask why.\n\n links left foot should be slightly below the center of the wood post circle. (x,z ) should be (-210.526, 234.079) \n\n90 left\nIncrementally ess left for about \u00be turn. End up slightly right of straight. 4 spikes should be visible on gate when targeted. Angle should be 47317\n\nHold up for 2 frames. Flick should work. (x, z) should be (-214.219, 234.728)\n\n90 left\nIncrementally ess left for about 2\u00be turn. end up facing the edge of the shown wall. Angle is now 52504.\n\nJUMP INPUTS:\ntarget throughout\nhold up 2 frames\nhold up/upleft 1 frame (~25-45 joystick units left of straight up)\nhold up 1 frame\nhold left 3 frames\nhold up 6-7 frames\nhold right throughout"
