                "title": "[OoT 1.0] Glitched Damage Value without Deku Stick",
                "description": "This makes \"QPA\" possible as adult on N64. It works because of the 1.0 exclusive glitch that lets you use items on the frame the put-away animation starts:\n- Press A to put away the sword\n- Start falling and press B at the same time on the following frame\nThe put-away animation gets canceled by the jump-slash, but the sword disappears anyway (like when you're trying to do damage QPA but you get hit too late). The jump-slash then sets the damage value, but Link has no sword in hand anymore, so you get the glitched hitbox.\n\nThis works with all swords, hammer and stick. The only requirement is either hover boots + any ledge, or a non-grabbable ledge you can fall off of and still land somewhere.\nWith hover boots, you have to gain some speed and let Link slide off the edge with no input, otherwise there is not enough hover time for the \"Put Away\" to appear on the icon.\n\nNote that you have to press A to put away the item and you cannot, for example, unequip it from the button after jumping: doing that would skip over the frame you need for the 1.0 glitch.\nAnother thing that works instead of pressing A is burning a stick, but that's obviously pretty useless because you can just do the normal QPA with burning stick then.\n\nEdit: Gabyelnuevo had found this already on the prerelease \"version 0.9\" of OoT https://youtu.be/8P_eV6kTvI4"
