                "description": "Another run I did a while ago and was just lazy with uploading.  Originally done on January 20th.\n\nWatch live at http://www.twitch.tv/zfg1 \n\nFor those who don't know what master quest is, it is a version of OoT with remixed dungeons made to be harder which was given away as a preorder bonus for The Wind Waker, and later also added into the 3DS remake.  The dungeons feature different puzzles and enemies with the same old dungeon layout, and everything outside of dungeons is exactly the same as normal OoT.  All of the glitches/mechanics of the game are the same as OoT version 1.2\n\nThis is a \"fake category\" I made myself meant to complete the parts of Master Quest that are different from original OoT, because everything outside of dungeons is the same, which is why I didn't want to do something like 100%.  This is essentially \"100% of the stuff that is different in MQ\" (except the ice cavern heart piece and the bow).  The exact requirements for this run are:  \n\nDeku tree (4 gold skulltulas)\nDodongo's Cavern (5 gold skulltulas)\nJabu (4 gold skulltulas)\nForest Temple (5 gold skulltulas)\nFire Temple (5 gold skulltulas)\nWater Temple (5 gold skulltulas)\nShadow Temple (5 gold skulltulas)\nSpirit Temple (5 gold skulltulas)\nIce Cavern (3 gold skulltulas) (iron boots)\nBottom of the Well (3 gold skulltulas) (lens of truth)\nGerudo Training Grounds (0 gold skulltulas)(ice arrow)\nGanon's Castle Trials\nBeat Ganon\n\nThe reason I added seemingly arbitrary requirements like the gold skulltulas and ice cavern/bottom of the well/gerudo training grounds is because something like a regular all dungeons speedrun would still skip so much of most dungeons that there's not a lot of new content.  It's still a bit different from regular OoT, but I feel like this category, despite being far more arbitrary, is much better because its so significantly different from OoT.\n\nThe dungeons being so different make this run very different compared to original OoT and offers a lot of new interesting ways to speedrun the game.  I hope you enjoy some of the unique tricks MQ has to offer.\n\nOverall good run except for losing a minute+ in deku tree"
